import React from 'react';
import './Home.css';

const HomePage = () => {
  return (
    <div className="homepage">
      <div className="homepage-header">
        <h2 className="title"> Devs On Deck</h2>
        <p className="subtitle">Your platform for connecting developers and job opportunities.</p>
        <div className="search-bar">
          <input type="text" placeholder="Search for jobs or companies..." />
          <button>Search</button>
        </div>
      </div>

      <div className="blog">
        <h3>Latest Blog Posts</h3>
        <div className="blog-posts">
          {[
            { title: "5 Tips for a Successful Job Interview", excerpt: "Ace your next interview with these 5 essential tips..." },
            { title: "How to Build a Personal Portfolio", excerpt: "Learn the best practices for creating an effective portfolio..." },
            { title: "Top 10 Tools Every Developer Should Know", excerpt: "Here are 10 tools that will boost your productivity as a developer..." }
          ].map((post, index) => (
            <div className="blog-post-card" key={index}>
              <h4>{post.title}</h4>
              <p>{post.excerpt}</p>
              <button>Read More</button>
            </div>
          ))}
        </div>
      </div>


  </div>
      
  );
};

export default HomePage;
